import React, { Component } from "react";
import { connect } from "react-redux";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Login from "./components/login.component";
import Register from "./components/register.component";
import Profile from "./components/profile.component";
import User from "./components/user.component";
import NetworkTest from "./components/NetworkTest";
import TestHistory from "./components/TestHistory";
import { logout } from "./actions/auth";
import { clearMessage } from "./actions/message";
import EventBus from "./common/EventBus";

class App extends Component {
  constructor(props) {
    super(props);
    this.logOut = this.logOut.bind(this);

    this.state = {
      currentUser: undefined,
    };
  }

  componentDidMount() {
    const user = this.props.user;

    if (user) {
      this.setState({
        currentUser: user,
      });
    }

    EventBus.on("logout", () => {
      this.logOut();
    });
  }

  componentWillUnmount() {
    EventBus.remove("logout");
  }

  logOut() {
    this.props.dispatch(logout());
    this.setState({
      currentUser: undefined,
    });
  }

  render() {
    const { currentUser } = this.state;

    return (
      <Router>
        <div>
          {/* Navbar */}
          <nav className="navbar navbar-expand navbar-light" style={{ backgroundColor: "#87ceeb" }}>
            <Link to={"/"} className="navbar-brand text-white">
              NetPerfAnalyzer
            </Link>
            <div className="navbar-nav mr-auto">
              {currentUser && (
                <li className="nav-item">
                  <Link to={"/user"} className="nav-link text-white">
                    Resource
                  </Link>
                </li>
              )}
            </div>

            {currentUser ? (
              <div className="navbar-nav ml-auto">
                <li className="nav-item">
                  <Link to={"/profile"} className="nav-link text-white">
                    Profile
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={"/network-test"} className="nav-link text-white">
                    Network Test
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to={"/test-history"} className="nav-link text-white">
                    Test History
                  </Link>
                </li>
                <li className="nav-item">
                  <Link to="/login" className="nav-link text-white" onClick={this.logOut}>
                    LogOut
                  </Link>
                </li>
              </div>
            ) : (
              <div className="navbar-nav ml-auto">
                <li className="nav-item">
                  <Link to={"/login"} className="nav-link text-white">
                    Login
                  </Link>
                </li>

                <li className="nav-item">
                  <Link to={"/register"} className="nav-link text-white">
                    Sign Up
                  </Link>
                </li>
              </div>
            )}
          </nav>

          {/* Content */}
          <div className="container mt-3" style={{ backgroundColor: "#e0f7fa", padding: "20px", borderRadius: "8px" }}>
            <Switch>
              <Route exact path={["/", "/register"]} component={Register} />
              <Route exact path="/login" component={Login} />
              <Route exact path="/register" component={Register} />
              <Route exact path="/profile" component={Profile} />
              <Route exact path="/user" component={User} />
              <Route exact path="/network-test" component={NetworkTest} />
              <Route exact path="/test-history" component={TestHistory} />
            </Switch>
          </div>
        </div>
      </Router>
    );
  }
}

function mapStateToProps(state) {
  const { user } = state.auth;
  return {
    user,
  };
}

export default connect(mapStateToProps)(App);
